import * as React from 'react';

import { Icon } from '@material-ui/core';
import Github from '../svgs/github.svg';
import Linkedin from '../svgs/linkedin.svg';

const Icons = (props) => {
  return (
    <div className='icons'>
      <Icon className='github-icon' classes={{root: props.classes.cconRoot}}><Github /></Icon>
      <Icon className='linkedin-icon' classes={{ root: props.classes.cconRoot }}><Linkedin /></Icon>
    </div>
  );
}

export default Icons;
